import React from 'react';
import { 
    Panel,
    PanelHeader,
    PanelHeaderButton,
    ScreenSpinner,

    Group,
    Input,
    Avatar,
    Button,
    Alert,
    Placeholder,
    Separator,
    PullToRefresh,
    PanelSpinner,
    InfoRow,
    Header,
    Counter,
    SimpleCell,
    PromoBanner,
    FixedLayout,
    Cell,
    Div,
    HorizontalScroll,
    View,
    Switch,
    Snackbar,
    PanelHeaderBack,
    CellButton,
    } from '@vkontakte/vkui';

import Icon24Repeat from '@vkontakte/icons/dist/24/repeat';
import Icon28MoneyCircleOutline from '@vkontakte/icons/dist/28/money_circle_outline';
import Icon28GlobeOutline from '@vkontakte/icons/dist/28/globe_outline';

import Icon28MoneyHistoryBackwardOutline from '@vkontakte/icons/dist/28/money_history_backward_outline';
import Icon24BrowserBack from '@vkontakte/icons/dist/24/browser_back';
import Icon16CheckCircle from '@vkontakte/icons/dist/16/check_circle';
import Icon28GridSquareOutline from '@vkontakte/icons/dist/28/grid_square_outline';
import Icon20CancelCircleFillRed from '@vkontakte/icons/dist/20/cancel_circle_fill_red';


export default class Settings extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            api_url: "https://xelene.ru/road/php/index.php?",

        }
        var props = this.props.this;
        this.setPopout = props.setPopout;
        this.showErrorAlert = props.showErrorAlert;
        this.showAlert = props.showAlert;
        this.setActiveModal = props.setActiveModal;
        this.onChange = (event) => {
            var name = event.currentTarget.name;
            var value = event.currentTarget.value;
            this.setState({ [name]: value });
        }
    }

    render() {
        var props = this.props.this;
        return(
            <Panel id={this.props.id}>
                <PanelHeader 
                    left={
                        <PanelHeaderBack onClick={() => this.props.this.goBack()} /> 
                }>
                    Настройки
                </PanelHeader>
                <Group>
                  <SimpleCell>Ваш возраст</SimpleCell>

                </Group>
                <Group>
                  <SimpleCell>Смена темы</SimpleCell>
                  <SimpleCell>Ваш возраст</SimpleCell>
                </Group>
                <Group>
                  <SimpleCell>Баланс</SimpleCell>
                </Group>
                <Group>
                  <CellButton mode="danger">Удалить аккаунт</CellButton>
                </Group>
            </Panel>
        )
    }
}
